import "../../../Styles/Pages/Shop/ShopSecond.scss";

function ShopSecond() {
  return (
    <div className='shopSecond'>
      <div className='homeSecond__line'></div>
      <h1>What's New?</h1>
    </div>
  );
}

export default ShopSecond;
